        (1776160, 'Bishop Stevens', NULL, 'Bishop Stevens is a former WCW-WWE pro-wrestler turned actor in 2014. As a wrestler Bishop trained with the legendary 8 time Champion Harley Race and signed with World Championship Wrestling which was later purchased by the WWF (now the WWE). Early in his acting career he appeared on some of the hottest network and cable television shows including AMC''s The Walking Dead, FOX''s Empire, NBC''s Chicago PD before landing his 1st guest starring role on the Verizon go90''s hit political series Embeds starring Don Tieri and Alexis Zalar. . In the last few years Stevens has become known as one of the mid-west fastest rising movie actors landing roles in 4 major Hollywood motion pictures being released throughout 2018 Nicolas Cage''s-Mom and Dad, Chance the Rapper''s-Slice, Colin Ford''s-Family Blood, Ellen Page''s-My Days of Mercy Bishop also landed starring roles in three other Hollywood films being released in 2018, the 1st developed by High Point Pictures also starring veteran actor Michael Pare'' called LockDown. The 2nd developed by Homesick Media called Thy Neighbor which has been nominated for 5 awards in 2018 ICFF including best picture. The 3rd a Syfy alien film also starring veteran actor Tim O''Leary called No Good Heroes. In addition to acting, Bishop is a motivational speaker and fitness enthusiast. He''s also becoming very well-known on the SyFi and Horror convention circuit making guest appearances at conventions though out the mid-west.', NULL, 1, '/e7sPcKUdzeakGHllbNRKXFpWpmO.jpg'),
