        (1776385, 'Solly Assa', '1972-04-02', 'American actor Solly Assa has starred in numerous films, as well as television series. He was born in 1972, in a small city in Alabama, and was an only child. Unfortunately, when he was around 9 years old, his father died in a car accident and he was raised by his mother and grandparents. Growing up he didn''t believe he would become an actor, even though he was very interested in the performing arts. He studied at Auburn University, College of Liberal Arts, and graduated with a degree in theater arts. After finishing his studies, he did some work behind the camera, assisting in the production of some independent films in his native Alabama. In his mid 20''s Solly Assa moved to Los Angeles where he began his career by landing smaller parts in films and on television.

His first big on-screen role came in 1996 when he was cast as Jake in "The Path to Happiness", a film adaptation of a popular British novel. The following year Solly Assa landed yet another film role, this time starring opposite some of Holywood biggest stars. Finally, he made his decision to permanently move to Los Angeles and build his life and career here, determined to make it as an actor. While pursuing his acting career he also met his wife Halley. The couple got married in 1998, and today they have three children. They still live in L.A as a family.

His professional training helped him a lot in the auditioning process. By early 2000, he had already appeared in over 7 movies and 5 television series. Some of his early roles included guest spots on television series, but that didn''t bother him at all since it was all going in accordance to his plan. He believed in himself and was convinced that the best is yet to come, and eventually, all of his hard work paid off.

His breakout role may have been in the book adaptation film allowed him to built a successful career in both television and film. Until this day he is known for her small-screen work, and has also taken notable film roles. Throughout his career, he has received two Golden Globe Nominations and has received numerous awards and public recognition. In the realm of television, Solly Assa gained recognition for his work on the independent movie "Glorie Days", for which he won an IFTA Award for Best Supporting Actor.', 'Dothan, Alabama, USA', 1, NULL),
