        (1816403, 'Leslie A. Hughes', NULL, 'Actress/Model Leslie A. Hughes was Born in Fort Dodge, IA. She has been gifted with a tremendous amount of talent and charisma. Her sophistication and grace has brought her into a prosperous acting career. At the age of seven, Hughes was relocated from her hometown and raised in Ruskin, FL. Upon her youth Hughes became passionate about the entertainment industry and fascinated with award shows. The speeches, performances, celebrities and above all else the journeys of the artists encouraged Hughes to put her best foot forward. Hughes passion started at a young age, debuting in theatre and choir performances at church and outside community performances. From performing on the theatre stage to runways, her talent naturally lead her onto television. She earned many spreads in magazines, newspapers, articles and appearances in films and commercials. Recognized for her most recent role as a contestant on ABC''s The Bachelor, CW''s 90210, and Nickelodeon''s Kickin It. She has also logged airtime on a variety of networks from Fox, CBS, MTV, Bravo, Disney and Hallmark Channel, one can say Hughes is at the peak of her career. In addition, Hughes is an active volunteer of philanthropy work. Her involvement with Habitat for Humanity, the Children''s Hospital, Children''s Hunger Fund, and Compassion International are keen traits to her humility and success. Hughes love for community service work has sparked a special place in her heart and has high hopes to one day establish her own non-profit organization.', 'Fort Dodge, Iowa, USA', 1, '/ihhstLzFqzYCICREPSEvSJvW5NF.jpg'),
