        (1852881, 'Lauren Ann Williams', '1981-09-13', 'is a Canadian professional wrestler best known for her time with Impact Wrestling (TNA) under the ring name Angelina Love, where she has held the TNA Knockouts Championship six times, which is a TNA record. Love is also a former one-time Knockouts Tag Team Champion with Winter. She works outside of TNA under the ring name Angel Williams.  Professional wrestling career Williams debuted in wrestling in 2000, working independent promotions around Canada. Her all-time favorite wrestler Shawn Michaels was her inspiration to get into wrestling. She was first a valet for various wrestlers such as Chris Sabin and Eric Young and then began to train under Rob Fuego to become a wrestler, as well. Williams briefly worked for Total Nonstop Action Wrestling (TNA) in 2004, mainly wrestling on TNA Xplosion against Trinity.  World Wrestling Entertainment (2004–2007) She was working for promotions around America when World Wrestling Entertainment (WWE) spotted her, and invited her to a tryout in June 2004. In November she trained at Ohio Valley Wrestling, and WWE signed her to a developmental contract in late 2004. She was assigned to wrestle and train in Deep South Wrestling (DSW), one of WWE''s developmental territories. Williams began managing Johnny Parisi in the summer of 2005. On September 8, 2005, Williams won her first match in Deep South by defeating Michelle McCool. On September 22, Williams was scheduled to wrestle against McCool, but Michelle never showed up. Instead Daisy Mae came out and challenged Williams. Williams was injured at the February 9, 2006 DSW TV Tapings, but she still managed to participate in the first ever Bikini Contest in DSW. She did not reveal her bikini because Palmer Cannon interrupted, which led to a match that featured him and Tommy Dreamer. During the match she could not physically get involved, so she walked backstage. On February 28, 2006, she underwent knee surgery in Birmingham, Alabama to repair her torn ACL. After almost seven months of rehab, she stepped back into the ring at a DSW TV taping. At the beginning of November 2006, Williams started managing The Gymini, but The Gymini were released from their contracts in January 2007. Williams then got in a feud with General Manager of DSW, Krissy Vaine, after she made Williams lose her matches due to distractions by other Deep South Divas. At one point Williams had enough and even attacked Vaine in her office. At the March 15, 2007 Deep South TV Tapings Williams aligned herself again with Vaine and was promoted the Co-GM of Deep South Wrestling. When Deep South Wrestling shut down in April, Williams was moved to Ohio Valley Wrestling. Williams made her Ohio Valley Wrestling debut in a dark match at the May 16, 2007 television taping in Louisville, Kentucky, defeating Serena. She was released from her developmental contract one day later.', 'Toronto, Ontario,  Canada', 1, '/nXuu1mJmsF5QqC45lLzyhsDKiio.jpg'),
