        (1894918, 'Tina Guo', NULL, 'Tina Guo is an internationally acclaimed and Grammy-nominated virtuoso acoustic/electric cellist, recording artist, and composer. With a multi-faceted career and mastery in a wide range of genres, her passion for musical exploration, artistic expression, and technology are expressed through live performance and visual media. Tina can also be heard as a featured soloist in many Blockbuster Film, Television, and Game scores.

