        (1911673, 'Camila Cabello', '1997-03-03', 'Karla Camila Cabello Estrabao (born March 3, 1997) is a Cuban-American singer and songwriter. She rose to prominence as a member of the girl group Fifth Harmony, which was formed on the second season of the American edition of The X Factor in 2012, and thereafter signed to a joint record deal with Syco Music and Epic Records for their music releases.

