        (1922275, 'Dolores DeLuce', '1947-01-01', 'Dolores DeLuce has done it all — and before they even had a name for it. Mentored by the legendary drag queen Divine and part of the infamous gender-bending 1970s troupe the Cockettes, DeLuce came of age in the decadent 1960s and 1970s, and lived to tell the tale in her raucous memoirs My Life, A Four Letter Word: Confessions of a Counter Culture Diva and Blow Jobs: A Guide to Making It in Show Business (or Not!). Featured in the documentary I Am Divine, this pint-sized powerhouse can also be seen (briefly!) in mainstream efforts like True Blood. Though her road has sometimes been bumpy, the world is a funkier, funnier place with DeLuce in it.', NULL, 1, '/xDBg5cIDBrwVKXF09rx9gQUNYK5.jpg'),
