        (1982705, 'Fen Tian', '1939-01-01', 'Jennifer Ten (born Fen Tian 田芬; January 1939 - March 2018) was a Chinese director, screenwriter and producer. She was born in the Province of Qingdao, Shandong, China.

In 1962 she graduated from the drama department of Lanzhou Institute of Arts. She successively served as a member of the Henan Provincial Drama Troupe, an actor of the Guangxi Drama Troupe, a trainee of the Beijing Film Academy, and a creator of the Guangxi Cultural Bureau and a playwright of the China Youth Art Theatre.

During several years she worked in the creation of scripts for different drama plays in China, some of were turn into films. In 2011 she directed her fist feature film "Love on a Leash" for  the Chinese-American company Fenix Pictures, an straight to DVD fantasy movie that through the years became some sort of cult classic. Two years later in her own homeland she wrote and directed another film called "Forbidden Kiss" a period romance drama about the cultural clash  between West and Asian culture.', 'Qingdao, Shandong Province, China', 1, '/g9QTZdko5khiXRZ0ohymDx19eyG.jpg'),
