        (1984453, 'Buddy Campbell', '1968-11-24', 'Buddy Campbell grew up in the Ozark Foothills of Arkansas. While getting his degree from Arkansas Tech University he took several jobs including a position with his hometown newspaper as a movie critic. While getting paid to watch every movie that came to town, he became hooked on the cinema. He got leads in college plays but when he graduated he thought his acting career was over. For the next twenty years or so he made a living in the real world doing "real" jobs but his love for movies never died. In 2013, he answered an open casting call for a feature film that was dear to his heart. The movie was called Greater and it was the true story of one of his beloved Arkansas Razorback football players who died tragically in a car crash several years earlier. He auditioned for the movie and was asked to play the role of a high school teacher in the movie. While he had no lines, the experience of being on a genuine movie set gave him the bug to do more of it. He decided to attend a class for new actors at Excel Models and Talent in Little Rock. The experience of working with like-minded people as well as the words of wisdom from owner Melissa Moody cemented his desire to make acting his new life goal. He was cast by producer James Wood in a short movie called Hare Trigger directed by Donavon Thompson. His performance in Hare Trigger was noticed. Shortly thereafter, he was asked to join the cast of a feature film called The Boo. This was followed by a string of offers that included more feature films and movie shorts as well as a TV series and a commercial. He finally believes his life is on the path he was destined for and couldn''t be happier with the results so far.', 'Arkansas, USA', 1, '/pAtCDFmOm7pQqOeWGfkJmiwRncj.jpg'),
