        (2016486, 'Trombone Shorty', '1986-01-02', 'Troy Michael Andrews was a 4-year-old boy when he first-handed a trombone. That young player emulated the musicians he heard playing in the “second line” parades, most notably his older brother James, a skilled performer in his own right. Young Troy was so small, and his instrument was twice his size, that he earned the nickname “Trombone Shorty”. Over the years, he listened attentively to his elders who educated him on the New Orlean’s deeply-rooted musical traditions. His capable hands absorbed these lessons, and he practiced constantly. A band-leader at age 8 and touring musician at 10, Trombone Shorty’s horn became his passport that opened the doors to the world.

Respectful of and inspired by the music’s history, Troy developed a foundation built upon the many musical traditions of his hometown (jazz, gospel, and R&B), and updated them with modern rock and hip-hop influences. In doing so, he has created his own style, one he calls “SupaFunkRock”.', 'New Orleans, Louisiana, USA', 1, '/iVf6HqwpxF6uOsIB82MVJv4Z55Z.jpg'),
