        (2075492, 'Clay von Carlowitz', NULL, 'Clay von Carlowitz is an actor and filmmaker based in NYC. A graduate of Kenyon College, he made his feature film debut as actor, writer and director in ''The House in the Woods,'' before scoring the role of Eugene in Troma''s ''Return to Nuke ''Em High.'' He''s since appeared in the satirical comedy play ''Ophelia'' with Gotham Dance Theater, ''Danny and the Deep Blue Sea'' at the Robert Moss Theater in the East Village, Kafka-themed web series ''Under InspeKtion,'' Liam Regan''s horror comedy ''My Bloody Banjo'' and Michael Walker''s meta-slasher ''Cut Shoot Kill.'' Through his Abandoned House Productions banner (co-owned by wife Asta Paredes), he wrote, directed and acted in ''The Shadow Scarf'' and co-produced Paredes'' ''The Slightest Touch.'' Lead roles in recent horror shorts ''Scorch'' and ''They Never Left'' won acclaim on the festival circuit, and soon he''ll be acting in ''Eros Point,'' a romantic arthouse horror short. He''s currently developing a feature-length thriller from his own script.', 'Ohio', 1, '/7j16iU89LtLqugPnj2DmLMbqEqP.jpg'),
