        (2087938, 'Konstantin Stanislavsky', '1863-01-17', 'Konstantin Sergeievich Stanislavsky was a seminal Russian theatre practitioner. He was widely recognised as an outstanding character actor and the many productions that he directed garnered a reputation as one of the leading theatre directors of his generation.', 'Moscow, Russian Empire', 1, '/u4j9MzF3SxoABRKemZaLp1rvpaO.jpg'),
