        (2149478, 'J.Stephen Brantley', NULL, 'J.Stephen Brantley has appeared Off-Broadway in The Directors Co production of Murder In The First at 59E59, Ensemble Studio Theatre''s Mope, and Theatre 167’s Pirira. Brantley has also worked with Big Dance, CapsLock, Cucaracha, Hard Sparks, Horse Trade, Jewish Plays Project, and Neo-Political Cowgirls, and at venues including HERE, Queens Theatre, LaMaMa, Metropolitan Playhouse, The New Ohio, P.S.122, and Soho Rep. His regional credits include Of Mice And Men at Bay Street and North Coast Rep, The Night Alive at Guild Hall, Slap & Tickle at Provincetown Theater, and Romeo And Juliet with it’s zombie sequel R & J & Z at Stonington Opera House. Film and television credits include ''The Blacklist'' (NBC), ''Neon Joe, Werewolf Hunter'' (Adult Swim), ''Difficult People'' (Hulu) and Eliza Hittman''s indie feature ''Beach Rats''.

Brantley is also a playwright whose work has been produced across the U.S. and in Canada and Ireland. As a member of Theatre 167, he co-wrote and performed in Jackson Heights 3am and I Like To Be Here: Jackson Heights Revisited, Or, This Is A Mango. Brantley is a graduate of NYU’s Experimental Theatre Wing, an eight-time NYIT nominee, and a member of the Indie Theatre Hall Of Fame. He was awarded the Micheál MacLiammóir Award for Best Actor at the 2013 International

