        (2285837, 'Mike Bell', '1971-03-18', 'Mike Bell was an American professional wrestler who worked for the World Wrestling Federation (WWF) and Extreme Championship Wrestling (ECW) as Mike "Mad Dog" Bell. He is the brother of Mark Bell.

Professional wrestling career

Bell worked as a jobber for the WWF during the early 1990s and appeared on Monday Night Raw. He, however, never had a contract with the company. He later worked with ECW and appeared at the Mid-Hudson Civic Center.

Bell was well known amongst the wrestling community after an incident with professional wrestler Perry Saturn during a dark match in the WWF. During the match, Bell attempted a snapmare armdrag on Perry, which left Perry concussed. Perry instinctively began kicking Bell and then threw him out of the ring, causing Bell to land on his head. Bell sustained a heavy injury to his neck. Saturn then proceeded to throw Bell into a set of metal stairs, further injuring him.  Personal life

Bell, who had a history with substance abuse, was featured in the documentary Bigger, Stronger, Faster along with his two brothers. On December 14, 2008, he was found dead at a rehabilitation facility in Costa Mesa, California. Bell was 37 years old.', 'Poughkeepsie, New York, USA', 1, '/lXJMAERTTK39MwaWCzEtJVyjJUx.jpg'),
