        (2296235, 'Lexi Rabe', '2012-06-15', 'This dynamic little six year old mesmerizes everyone she meets. Heading into first grade she lives a normal life, church, chores, public school, playing with friends but every couple months she takes off a couple weeks or after school and makes a movie. Miss Lexie loves bugs, playing in water and being a princess. She is very outgoing and makes friends where ever she goes, with every age, color, and creed. Lexie loves animals and brings home any stray she can sneak into the house.', 'United States', 1, '/uI4hSGy4TXy9nKalVTu3XTwAUeI.jpg'),
